import React, { useState, useEffect } from 'react';

function Home() {
  const [predictedPrice, setPredictedPrice] = useState(null); // State to hold the predicted price

  useEffect(() => {
    // Fetch the predicted price from the backend
    const fetchPredictedPrice = async () => {
      try {
        const response = await fetch('http://localhost:5000'); // Adjust the URL if necessary
        if (response.ok) {
          const data = await response.json();
          setPredictedPrice(data['predicted price'][0]); // Access the price from the JSON response
        } else {
          console.error('Failed to fetch predicted price');
        }
      } catch (error) {
        console.error('Error fetching predicted price:', error);
      }
    };

    fetchPredictedPrice();
  }, []); // Empty dependency array ensures the fetch runs only once

  return (
    <div>
      <h1>Home</h1>
      {predictedPrice !== null ? (
        <p>Predicted Price: ${predictedPrice.toFixed(2)}</p>
      ) : (
        <p>Loading predicted price...</p>
      )}
    </div>
  );
}

export default Home;
